import React from 'react';
import './Login.css';

const Login = (props) => {
  return (
    <div className="authcontainer">
      <span>Welcome back!</span>
      <div className="authcontainer__section">
        <span>Email</span>
        <input />
        <span>Password</span>
        <input />
        <h4>Forgot your password?</h4>
        <button>Login</button>
        <p>Need an account? Register.</p>
      </div>
    </div>
  );
};

export default Login;
